import React from 'react';
import ReactDOM from 'react-dom/client';


function App(){
  return(
    <main>
      <h1>Hello</h1>
      <Image />
    </main>
  )
}

function Image(){
  return(
    <img src='new.jpg'></img>
  )
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
